import { sitemapBuilder as buildSitemap } from 'react-router-sitemap';

const pages = ['bio', 'portfolio', 'thoughts', 'journies']
const hostname = 'http://braedenmeikle.dev';
const sitemap = buildSitemap(hostname, pages);

export { pages }
